import { useState } from "react";
import "../styles/stylesheet.css";

const Secrets = () => {
    
    const [secret, setSecret] = useState([]);

    return (
        <div>
            <h2>Add your secret here and keep it secure.</h2>
            <div>
                <input type="text" placeholder="Type a secret" />
                <button>Add</button>
            </div>
            <button>Log Out</button>
        </div>
    )
}

export default Secrets;
